# declarations for Test-TCPConnectionAsync function
using namespace System.Diagnostics
using namespace System.Collections.Generic
using namespace System.Collections.Specialized
using namespace System.Net.Sockets
using namespace System.Threading.Tasks

[cmdletbinding()]
param (
    [ValidateSet('SMB','WinRM')]
    [string]$CollectionMethod = "WinRM",
    [ValidateRange(5, 1800)]
    [int]$SMBTimeOut = 30,
    [switch]$WorkstationsOnly = $false,    
    [switch]$IncludeComputerTGT = $false,
    [string]$DomainDN = $(([adsi]'').distinguishedName),
    [string]$ScriptFolder,
    [System.Management.Automation.PSCredential]$Credential,
    [switch]$StartWinRMServiceOnEndPoints = $false,
    [switch]$EnablePSRemotingOnEndPoints = $false,
    [Parameter(Mandatory=$false,ValuefromPipeline=$True)]
    [string[]]$ComputerName = [System.String]::Empty,
    [string[]]$ExcludedComputerName = [System.String]::Empty,
    [ValidateSet('FailedJobsOnly','Full')]
    [string]$LoggingLevel = 'FailedJobsOnly',
    [string]$LogName = [System.String]::Empty
)

# helper functions
function Log-Entry {
    param (
        [string]$Message
    )
    $global:sw.writeline($Message);
    $global:sw.flush();
}

function Test-TCPConnectionAsync {
    [cmdletbinding()]
    param(
        [parameter(Mandatory, Valuefrompipeline)]
        [string[]] $Target,

        [parameter(Mandatory, Position = 1)]
        [ValidateRange(1, 65535)]
        [int[]] $Port,

        [parameter(Position = 2)]
        [ValidateRange(500, [int]::MaxValue)]
        [int] $TimeOut = 1200
    )

    begin {
        $timer = [Stopwatch]::StartNew()
        $tasks = [List[OrderedDictionary]]::new()
    }
    process {
        foreach($t in $Target) {
            foreach($i in $Port) {
                $tcp = [TCPClient]::new()
                $tasks.Add([ordered]@{
                    Instance = $tcp
                    Task     = $tcp.ConnectAsync($t, $i)
                    Output   = [ordered]@{
                        Source       = $env:COMPUTERNAME
                        Destionation = $t
                        Port         = $i
                    }
                })
            }
        }
    }
    end {
        do {
            $id = [Task]::WaitAny($tasks.Task, 200)
            if($id -eq -1) {
                continue
            }
            $instance, $task, $output = $tasks[$id][$tasks[$id].PSBase.Keys]
            $output['Success'] = $task.Status -eq [TaskStatus]::RanToCompletion
            $instance.ForEach('Dispose') # Avoid any throws here
            $tasks.RemoveAt($id)
            [pscustomobject] $output
        } while($tasks -and $timer.ElapsedMilliseconds -le $timeout)

        foreach($t in $tasks) {
            $instance, $task, $output = $t[$t.PSBase.Keys]
            $output['Success'] = $task.Status -eq [TaskStatus]::RanToCompletion
            $instance.ForEach('Dispose') # Avoid any throws here
            [pscustomobject] $output
        }
    }
}

