    Suspicious kerberos tickets detection script v$version
    "...Keeps me searching for a ticket of gold (and/or Pass-The-Hash)"
    by 1nTh35h311 (@yossi_sassi)


"@

$Logo

# Check for Collector script in folder
if (Test-Path .\GoldFinger-EndPointTicketCollector.ps1) {
        Write-Host "[*] Collector script found in scripts folder." -ForegroundColor Green
    }
    else
    {
        Write-Host "[!] Script 'GoldFinger-EndPointTicketCollector.ps1' was Not found in $ScriptFolder. Quiting." -ForegroundColor Yellow
        exit
    }

# Logging - kick off
if ($LoggingLevel -eq 'Full')
    {
        $global:sw = New-Object System.IO.StreamWriter -ArgumentList $LogName, $true;
        Log-Entry -Message "$(Get-date): Started 'Suspicious kerberos tickets detection script' v$version";
    }

# Set window title & error action preference
$global:CurrentConsoleTitle = $Host.ui.RawUI.WindowTitle;
$Host.ui.RawUI.WindowTitle = "GoldFinger - Suspicious kerberos tickets detection script v$version <Started: $(get-date)>";
$global:CurrentEAP = $ErrorActionPreference;
$ErrorActionPreference = "SilentlyContinue";

# function to set back previous window title & error action preference
function Set-PreviousString {
    # set previous window title
    $Host.ui.RawUI.WindowTitle = $global:CurrentConsoleTitle;
    # set previous error action preference
    $ErrorActionPreference = $global:CurrentEAP;
}

Write-Host "[*] Collection method: $CollectionMethod" -ForegroundColor Cyan;

# Logging - kick off
if ($LoggingLevel -eq 'Full')
    {
        Log-Entry -Message "$(Get-date): Collection method: $CollectionMethod";
    }

# Check if specific credentials where specified
if ($Credential)
    {
        Write-Host "[*] Running as $(($Credential.UserName).ToUpper()) <Domain: $DomainDN>";
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Running as $(($Credential.UserName).ToUpper()) <Domain: $DomainDN>"}
    }
else
    {
        Write-Host "[*] Running as $([System.Environment]::UserDomainName)\$([System.Environment]::UserName) <Domain: $DomainDN>";
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Running as $([System.Environment]::UserDomainName)\$([System.Environment]::UserName) <Domain: $DomainDN>"}
    }

# Get Kerberos TGT Ticket Age, and Ticket Renewal Age
[int]$MaxTicketAge = (Get-Content "\\$($ENV:USERDNSDOMAIN)\SYSVOL\$($ENV:USERDNSDOMAIN)\Policies\{31B2F340-016D-11D2-945F-00C04FB984F9}\MACHINE\Microsoft\Windows NT\SecEdit\GptTmpl.inf" | Select-String MaxTicketAge).ToString().Split("=")[1].Trim()
Write-Verbose "MaxTicketAge = $MaxTicketAge hours (taken from Default Domain Policy)"

[int]$MaxRenewAge = (Get-Content "\\$($ENV:USERDNSDOMAIN)\SYSVOL\$($ENV:USERDNSDOMAIN)\Policies\{31B2F340-016D-11D2-945F-00C04FB984F9}\MACHINE\Microsoft\Windows NT\SecEdit\GptTmpl.inf" | Select-String MaxRenewAge).ToString().Split("=")[1].Trim()
Write-Verbose "MaxRenewAge = $MaxRenewAge days (taken from Default Domain Policy)"

# Create non-fixed size array for Computer List
$ComputerList = New-Object System.Collections.ArrayList;

# Default is collect kerberos tickets from all domain endpoints (or WorkstationsOnly) - check if SPECIFIC computers were specified
Switch ($ComputerName)
    {
        # if one or more computers were specified -
        {$_ -ne [System.String]::Empty} 
            {
            if ($ComputerName.count -eq 1) {$ComputerList.Add($ComputerName)} else {$ComputerList.AddRange($ComputerName)};
            Write-Host "[*] ComputerName was specified - targeting $($ComputerList.Count) computer(s)" -ForegroundColor Cyan;
            if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): ComputerName was specified - targeting $($ComputerList.Count) computer(s)"}

            break
            }

        # Default is query all domain computers - or workstations only - if Switch was applied
        default {
        # Get enabled computer accounts that are active in last 90 days (filtered by ENABLED computer accounts + DCs excluded), and remove default 1000 results size limit
        #$wsmanComputers = ([adsisearcher]'(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(serviceprincipalname=*wsman*)))').FindAll().Properties.dnshostname
        $DomainObj = New-Object System.DirectoryServices.DirectoryEntry -ArgumentList "LDAP://$DomainDN";
        $Searcher = New-Object System.DirectoryServices.DirectorySearcher -ArgumentList $DomainObj;

        $date = (Get-Date).AddDays(-90);
        $FileTimeUtc = $Date.ToFileTimeUtc();

        if ($WorkstationsOnly) {
                switch ($CollectionMethod)
                    {
                        "SMB" {$Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(lastlogontimestamp>=$FileTimeUtc)(!(operatingsystem=*Server*))))"}
                        "WinRM" {
                                    $Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(serviceprincipalname=*wsman*)(lastlogontimestamp>=$FileTimeUtc)(!(operatingsystem=*Server*))))";
                                    if ($EnablePSRemotingOnEndPoints)
                                                {$Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(!(operatingsystem=*Server*)(lastlogontimestamp>=$FileTimeUtc)(!(operatingsystem=*unknown*)))))"}
                                }
                    }
            }
            else
            { # default is all enabled domain computers with WSMAN SPN, Servers & workstations
                switch ($CollectionMethod)
                    {
                        "SMB" {$Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(lastlogontimestamp>=$FileTimeUtc)))"}
                        "WinRM" {
                                    $Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(!userAccountControl:1.2.840.113556.1.4.803:=2)(lastlogontimestamp>=$FileTimeUtc)(serviceprincipalname=*wsman*)))";
                                    if ($EnablePSRemotingOnEndPoints)
                                        {
                                            $Searcher.Filter = "(&(objectCategory=computer)(!(primaryGroupID=516)(lastlogontimestamp>=$FileTimeUtc)(!userAccountControl:1.2.840.113556.1.4.803:=2)))"
                                        }
                                }
                    }
            }

        $Searcher.SizeLimit = 2147483647;
        $Searcher.PageSize = 2147483647;
        $AllComputers = $Searcher.FindAll().Properties.dnshostname;

        Write-Host "[*] Found $($AllComputers.Count) potential computer accounts to examine";
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Found $($AllComputers.Count) potential computer accounts to examine"}

