                #$temp = & .\PSExec.exe \\$Computer -s -accepteula -nobanner -u $($Credential.UserName) -p $($credential.GetNetworkCredential().Password) powershell.exe -nop -nol -w hidden -exec bypass -file $ENV:windir\temp\GoldFinger-EndPointTicketCollector.ps1 2>&1
                #$temp = & .\PaExec.exe \\$Computer -s -dfr -u $($Credential.UserName) -p $($credential.GetNetworkCredential().Password) powershell.exe -nop -nol -w hidden -exec bypass -file $ENV:windir\temp\GoldFinger-EndPointTicketCollector.ps1 2>&1
                
                #$PAExecProcess = Start-Process .\PaExec.exe -PassThru -ArgumentList "\\$Computer","-s","-e","-d",'-dfr',"-lo .\PAExecLog_$($Computer.ToUpper()).txt",("-u "+$Credential.username),('-p '+$Credential.GetNetworkCredential().password),$Command -WindowStyle Hidden -ErrorVariable PAExecErr -Wait;
                
                # Note: added -to 30 for timeout. does Not work with -d
                # For verbose PaExec logging per run/per computer, uncomment this line and comment the next one instead
                #$runResult = Start-ProcessWithStdout -ProcessEXE "$((Get-Location).Path)\PaExec.exe" -arguments "\\$Computer","-s","-e",'-dfr',"-lo $((Get-Location).Path).\PAExecLog_$($Computer.ToUpper()).txt",("-u "+$Credential.username),('-p '+$Credential.GetNetworkCredential().password),$Command # can add -to 30 for timeout. does not work with -d
                $runResult = Start-ProcessWithStdout -ProcessEXE "$((Get-Location).Path)\PaExec.exe" -arguments "\\$Computer","-s","-e","-to $SMBTimeOut",'-dfr',("-u "+$Credential.username),('-p '+$Credential.GetNetworkCredential().password),$Command -Timeout $SMBTimeOut # -to $SMBTimeOut for timeout, does not work with -d
            }
        else
            {
                #$temp = & .\PSExec.exe \\$Computer -s -accepteula -nobanner powershell.exe -nop -nol -w hidden -exec bypass -file $ENV:windir\temp\GoldFinger-EndPointTicketCollector.ps1 2>&1
                #$temp = & .\PaExec.exe \\$Computer -s -dfr powershell.exe -nop -nol -w hidden -exec bypass -file $ENV:windir\temp\GoldFinger-EndPointTicketCollector.ps1 2>&1
                
                #$PAExecProcess = Start-Process .\PaExec.exe -PassThru -ArgumentList "\\$Computer","-s","-e","-to 30",'-dfr',"-lo .\PAExecLog_$($Computer.ToUpper()).txt",$Command -WindowStyle Hidden -ErrorVariable PAExecErr -Wait;

                # Note: Added -to XX for timeout. does Not work with -d
                # For verbose PaExec logging per run/per computer, uncomment this line and comment the next one instead
                #$runResult = Start-ProcessWithStdout -ProcessEXE "$((Get-Location).Path)\PaExec.exe" -arguments "\\$Computer","-s","-e",'-dfr',"-lo $((Get-Location).Path)\PAExecLog_$($Computer.ToUpper()).txt",$Command
                $runResult = Start-ProcessWithStdout -ProcessEXE "$((Get-Location).Path)\PaExec.exe" -arguments "\\$Computer","-s","-e","-to $SMBTimeOut",'-dfr',$Command -Timeout $SMBTimeOut
            }
        }

        # Get stdout and strErr
        $stdout = $runResult[-2]
        $stderr = $runResult[-1]

        # Error handling post-PaExec run
        #if (($PaexecErr) -or ($PAExecProcess.exitcode -ne 0)) 
        if ($stderr) 
            {                 
                switch ($stderr) {
                {$_ -like '*-1*'} {$ErrMessagePaExec = "PAExec -1 = internal error"}
                {$_ -like '*-2*'} {$ErrMessagePaExec = "PAExec -2 = command line error"}
                {$_ -like '*-3*'} {$ErrMessagePaExec = "PAExec -3 = failed to launch app (locally)"}
                {$_ -like '*-4*'} {$ErrMessagePaExec = "PAExec -4 = failed to copy PAExec to remote (connection to ADMIN$ might have failed"}
                {$_ -like '*-5*'} {$ErrMessagePaExec = "PAExec -5 = connection to server taking too long (timeout)"}
                {$_ -like '*-6*'} {$ErrMessagePaExec = "PAExec -6 = PAExec service could not be installed/started on remote server"}
                {$_ -like '*-7*'} {$ErrMessagePaExec = "PAExec -7 = could not communicate with remote PAExec service"}
                {$_ -like '*-8*'} {$ErrMessagePaExec = "PAExec -8 = failed to copy app to remote server"}
                {$_ -like '*-9*'} {$ErrMessagePaExec = "PAEXEC -9 = failed to launch app (remotely)"}
                {$_ -like '*-10*'} {$ErrMessagePaExec = "PAExec -10 = app was terminated after timeout expired"}
                {$_ -like '*-11*'} {$ErrMessagePaExec = "PAExec -11 = forcibly stopped with Ctrl-C / Ctrl-Break"}
                default {$ErrMessagePaExec = $stderr}
                }

                $FailedComputers += $Computer;
                # TBD: Do we want to log errors also when NOT LoggingLevel -eq Full ???
                if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): $Computer - Error during PaExec run: $ErrMessagePaExec."}
            }
        <#                
        # Check for errors after PaExec run
        if ($? -eq $false -and $Error[0] -notlike "*PAExec returning exit code 0*") # in PsExec: *powershell.exe exited on $computer with error code 0*
            {
                $FailedComputers += $Computer;
                if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): $Computer - Error during PaExec run - $($Error[0].Exception.Message)."}
            }
        #>
        else
            {
                if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): $Computer - PaExec finished attempted execution."}
            }

        # Remove collector script from destination computer
        if ($Credential)
            {
                Remove-Item \\$Computer\admin$\temp\GoldFinger-EndPointTicketCollector.ps1 -Force -Credential $Credential;
            }
        else
            {
                Remove-Item \\$Computer\admin$\temp\GoldFinger-EndPointTicketCollector.ps1 -Force;
            }
        
        # reset number of last collected tickets 
        [int]$NumberOfLastCollectedTickets = 0;

        # Get data and parse it
        $stdoutFix = $stdout -split "\n";

        $ServiceName = $stdoutFix | Select-String 'ServiceName                  :' | ForEach-Object { $_.ToString().Replace('ServiceName                  :','').Trim()}
        $ClientName = $stdoutFix | Select-String 'ClientName                   :' | ForEach-Object { $_.ToString().Replace('ClientName                   :','').Trim()}
        $DomainName = $stdoutFix | Select-String 'DomainName                   :' | ForEach-Object { $_.ToString().Replace('DomainName                   :','').Trim()}
        $TargetDomainName = $stdoutFix | Select-String 'TargetDomainName             :' | ForEach-Object { $_.ToString().Replace('TargetDomainName             :','').Trim()}
        $AltTargetDomainName = $stdoutFix | Select-String 'AltTargetDomainName          :' | ForEach-Object { $_.ToString().Replace('AltTargetDomainName          :','').Trim()}
        $SessionKeyType = $stdoutFix | Select-String 'SessionKeyType               :' | ForEach-Object { $_.ToString().Replace('SessionKeyType               :','').Trim()}
        $SessionKey = $stdoutFix | Select-String 'SessionKey                   :' | ForEach-Object { $_.ToString().Replace('SessionKey                   :','').Trim()}
        $TempTicketFlags = $stdoutFix | Select-String 'TicketFlags                  :' -Context 1;
        $TicketFlags = $TempTicketFlags | ForEach-Object {if ($_.Context.PostContext -like "KeyExpirationTime*") {$($_.Line.Replace('TicketFlags                  :','').Trim())} else {$("$($_.Line)$($_.Context.PostContext.Trim())").Replace('TicketFlags                  :','').Trim()}}
        $KeyExpirationTime = $stdoutFix | Select-String 'KeyExpirationTime            :' | ForEach-Object { $_.ToString().Replace('KeyExpirationTime            :','').Trim()}
        $StartTime = $stdoutFix | Select-String 'StartTime                    :' | ForEach-Object { $_.ToString().Replace('StartTime                    :','').Trim()}
        $EndTime = $stdoutFix | Select-String 'EndTime                      :' | ForEach-Object { $_.ToString().Replace('EndTime                      :','').Trim()}
        $RenewUntil = $stdoutFix | Select-String 'RenewUntil                   :' | ForEach-Object { $_.ToString().Replace('RenewUntil                   :','').Trim()}
        $TimeSkew = $stdoutFix | Select-String 'TimeSkew                     :' | ForEach-Object { $_.ToString().Replace('TimeSkew                     :','').Trim()}
        $EncodedTicketSize = $stdoutFix | Select-String 'EncodedTicketSize            :' | ForEach-Object { $_.ToString().Replace('EncodedTicketSize            :','').Trim()}
        $EncodedTicket = $stdoutFix | Select-String 'EncodedTicket                :' | ForEach-Object { $_.ToString().Replace('EncodedTicket                :','').Trim()}
        $TimeDiffInHours = $stdoutFix | Select-String 'TimeDiffInHours              :' | ForEach-Object { $_.ToString().Replace('TimeDiffInHours              :','').Trim()}
        $SessionLogonId = $stdoutFix | Select-String 'SessionLogonId               :' | ForEach-Object { $_.ToString().Replace('SessionLogonId               :','').Trim()}
        $SessionLogonIdString = $stdoutFix | Select-String 'SessionLogonIdString         :' | ForEach-Object { $_.ToString().Replace('SessionLogonIdString         :','').Trim()}
        $SessionUserName = $stdoutFix | Select-String 'SessionUserName              :' | ForEach-Object { $_.ToString().Replace('SessionUserName              :','').Trim()}
        $SessionUserPrincipalName = $stdoutFix | Select-String 'SessionUserPrincipalName     :' | ForEach-Object { $_.ToString().Replace('SessionUserPrincipalName     :','').Trim()}
        $SessionLogonType = $stdoutFix | Select-String 'SessionLogonType             :' | ForEach-Object { $_.ToString().Replace('SessionLogonType             :','').Trim()}
        $SessionAuthenticationPackage = $stdoutFix | Select-String 'SessionAuthenticationPackage :' | ForEach-Object { $_.ToString().Replace('SessionAuthenticationPackage :','').Trim()}
        $SessionLogonServer = $stdoutFix | Select-String 'SessionLogonServer           :' | ForEach-Object { $_.ToString().Replace('SessionLogonServer           :','').Trim()}
        $SessionSid = $stdoutFix | Select-String 'SessionSid                   :' | ForEach-Object { $_.ToString().Replace('SessionSid                   :','').Trim()}
        $SessionID = $stdoutFix | Select-String 'SessionID                    :' | ForEach-Object { $_.ToString().Replace('SessionID                    :','').Trim()}

        # Create ticket objects from parsed data
        for ($t = 0; $t -le $($ServiceName.Count -1); $t++)
            {
                $Ticket = New-Object psobject;
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name ServiceName -Value $ServiceName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name ClientName -Value $ClientName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name DomainName -Value $DomainName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name TargetDomainName -Value $TargetDomainName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name AltTargetDomainName -Value $AltTargetDomainName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionKeyType -Value $SessionKeyType[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionKey -Value $SessionKey[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name TicketFlags -Value $TicketFlags[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name KeyExpirationTime -Value $([datetime]$KeyExpirationTime[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name StartTime -Value $([datetime]$StartTime[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name EndTime -Value $([datetime]$EndTime[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name RenewUntil -Value $([datetime]$RenewUntil[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name TimeSkew -Value $([int]$TimeSkew[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name EncodedTicketSize -Value $([int]$EncodedTicketSize[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name EncodedTicket -Value $EncodedTicket[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name TimeDiffInHours -Value $([int]$TimeDiffInHours[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionLogonId -Value $SessionLogonId[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionLogonIdString -Value $($SessionLogonIdString[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionUserName -Value $($SessionUserName[$t]) -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionUserPrincipalName -Value $SessionUserPrincipalName[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionLogonType -Value $SessionLogonType[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionAuthenticationPackage -Value $SessionAuthenticationPackage[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionLogonServer -Value $SessionLogonServer[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionSid -Value $SessionSid[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name SessionID -Value $SessionID[$t] -Force
                Add-Member -InputObject $Ticket -MemberType NoteProperty -Name ComputerName -Value $Computer -Force
                $Tickets += $Ticket;
                $NumberOfLastCollectedTickets++
            }
            Clear-Variable ServiceName, ClientName, DomainName, TargetDomainName, AltTargetDomainName, SessionKey, SessionKeyType, TicketFlags, KeyExpirationTime, StartTime, EndTime, RenewUntil,TimeSkew, EncodedTicket, EncodedTicketSize, TimeDiffInHours, SessionLogonId, SessionLogonIdString, SessionUserName, SessionUserPrincipalName, SessionLogonType, SessionAuthenticationPackage, SessionLogonServer, SessionSid, SessionID
	    $i++;
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): $Computer - Found $NumberOfLastCollectedTickets tickets to collect (Including computer account tickets)."}
    }

    # Filter out computer account tickets, if not requested
    if ($IncludeComputerTGT) {
            $FilteredTickets = $Tickets;
            Write-Host "`n[*] Total of $($FilteredTickets.Count) Ticket(s) fetched.`n" -ForegroundColor Cyan;
            if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Total of $($FilteredTickets.Count) Ticket(s) fetched"}
        }
        else
        {
            $FilteredTickets = $Tickets | where ClientName -notlike "*$"
            Write-Host "[*] Total of $($FilteredTickets.Count) Ticket(s) fetched (excluding computer account tickets)." -ForegroundColor Cyan;
            if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Total of $($FilteredTickets.Count) Ticket(s) fetched (excluding computer account tickets)"}
        }

    # Delete temp remote exec file
    #if (Test-Path "$((Get-Location).Path)\PSExec.exe") {Remove-Item "$((Get-Location).Path)\PSExec.exe"};
    if (Test-Path "$((Get-Location).Path)\PAExec.exe") {Remove-Item "$((Get-Location).Path)\PAExec.exe"};
    }
}

## Potential Ticket Anomalies ##
$SuspiciousTickets = @();

# If winRM used - save the ticket results into same variable name (FilteredTickets)
if ($CollectionMethod -eq "WinRM") {$FilteredTickets = $CompletedJobsData}

# filter by KDC called is empty, and DNSHostName is different than the current computer name
$KDCnCompMismatch = @();
switch ($CollectionMethod)
    {
        "WinRM" {$KDCnCompMismatch += $FilteredTickets | where {$_.SessionLogonServer -eq '' -and $_.dnsHostName.ToString().Split(".")[0] -ne $_.PSComputerName}}
        "SMB" {$KDCnCompMismatch += $FilteredTickets | where {$_.SessionLogonServer -eq '' -and $_.dnsHostName.ToString().Split(".")[0] -ne $_.ComputerName}}
    }

if ($KDCnCompMismatch) {
        $KDCnCompMismatch | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value " KDC-Empty&Computer-Mismatch " -Force}
        $SuspiciousTickets += $KDCnCompMismatch
    }

# filter by Ticket age (Kerberos TGT max life time, default 10 hours)
$TicketAgeAnomaly = @();
$TicketAgeAnomaly += $FilteredTickets | where {$_.TimeDiffInHours -gt $MaxTicketAge}

if ($TicketAgeAnomaly)
    {
        $TicketAgeAnomaly | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value "$($_.Anomaly) | TicketAge " -Force}
        $SuspiciousTickets += $TicketAgeAnomaly
    }

# filter by Ticket renewal (default 7 days)
$Now = Get-Date;
$TicketRenewalAnomaly = @();
$TicketRenewalAnomaly += $FilteredTickets | where {([datetime]$_.RenewUntil - $Now).days -gt $MaxRenewAge}

if ($TicketRenewalAnomaly)
    {
        $TicketRenewalAnomaly | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value "$($_.Anomaly) | TicketRenewalTime " -Force}
        $SuspiciousTickets += $TicketRenewalAnomaly
    }

# filter by client name in ticket not matching session user name (the process user/whoami) - Strong indication
$SessionClientMismatch = @();
$SessionClientMismatch += $FilteredTickets | Where {$_.ClientName -ne $_.SessionUserName}

if ($SessionClientMismatch)
    {
        $SessionClientMismatch | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value "$($_.Anomaly) | !Session<>Client Mismatch! " -Force}
        $SuspiciousTickets += $SessionClientMismatch
    }

# filter by Session logon type == CachedInteractive (can lead to FalsePositive -> might be a runas/secondary logon on a machine - not a high-fidelity alert IF comes without any other additional anomaly!
$SessionLogonTypeAnomaly = @();
$SessionLogonTypeAnomaly += $FilteredTickets | Where {$_.SessionLogonType -eq "CachedInteractive"}

if ($SessionLogonTypeAnomaly)
    {
        $SessionLogonTypeAnomaly | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value "$($_.Anomaly) | SessionLogonTypeAnomaly " -Force}
        $SuspiciousTickets += $SessionLogonTypeAnomaly
    }

# filter by Encoded Ticket size - normally should be over 1000, anomolous are either 972 or 976, etc'
$EncodedTicketSizeAnomaly = @();
$EncodedTicketSizeAnomaly += $FilteredTickets | Where {$([int]$_.EncodedTicketSize) -lt 1000}

if ($EncodedTicketSizeAnomaly)
    {
        $EncodedTicketSizeAnomaly | ForEach-Object {Add-Member -InputObject $_ -MemberType NoteProperty -Name Anomaly -Value "$($_.Anomaly) | EncodedTicketSize<1000 " -Force}
        $SuspiciousTickets += $EncodedTicketSizeAnomaly
    }

Write-Verbose "Total of $($SuspiciousTickets.count) tickets matched different anomaly rules (non-Unique count)";

if ($SuspiciousTickets)
    {
        # add Suspicious attribute to result set
        $FilteredTickets | ForEach-Object {
            if ($_ -in $SuspiciousTickets) {
                    $SuspiciousTicket = $_;
                    if ($SuspiciousTicket.Anomaly -eq " | SessionLogonTypeAnomaly ") #LogonType is a low indication..
                        {
                            Add-Member -InputObject $_ -MemberType NoteProperty -Name "Suspicious" -Value "Low" -Force
                        }
                    elseif ($SuspiciousTicket.Anomaly -like "*!Session<>Client Mismatch!*" -and $SuspiciousTicket.SessionUserName -eq "SYSTEM") #SessionUser as SYSTEM can be False Positive, so lower indication
                        {
                            Add-Member -InputObject $_ -MemberType NoteProperty -Name "Suspicious" -Value "Low" -Force
                        }
                    elseif ($SuspiciousTicket.Anomaly -like "*!Session<>Client Mismatch!*") #Strong indication
                        {
                            Add-Member -InputObject $_ -MemberType NoteProperty -Name "Suspicious" -Value "High" -Force
                        }
                    else
                        {
                            Add-Member -InputObject $_ -MemberType NoteProperty -Name "Suspicious" -Value "True" -Force
                        }
                    }
        }

        # Prepare suspicious tickets/anomalies report
        $AnomaliesReportName = ".\GoldFinger-KerberosTicketsCheck-ANOMALIES-SUSPICIOUS_over_$CollectionMethod-Including-MultipleMatch-$(get-date -Format ddMMyyyyHHmmss).csv"
        switch ($CollectionMethod)
        {
            "WinRM" {$SuspiciousTickets | Select-Object @{N='ComputerName';E={$_.PSComputerName}},ClientName,Anomaly,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Export-csv $AnomaliesReportName -NoTypeInformation}
            "SMB" {$SuspiciousTickets | Select-Object ComputerName,ClientName,Anomaly,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Export-csv $AnomaliesReportName -NoTypeInformation}
        }
        
        switch ($CollectionMethod)
            {
                "SMB" {$ComputerWithAnomolousTGT = $SuspiciousTickets.Computername | Select-Object -Unique}
                "WinRM" {$ComputerWithAnomolousTGT = $SuspiciousTickets.PSComputername | Select-Object -Unique}
            }
        
        # Unify results of suspicious tickets
        $SuspiciousTickets = $SuspiciousTickets | group SessionLogonID | ForEach-Object {$_.group | select -First 1}
        Write-Verbose "Found $(($SuspiciousTickets | Measure-Object).count) potentially suspicious tickets (Unique count)";
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): ! Found $(($SuspiciousTickets | Measure-Object).count) potentially suspicious tickets (Unique count) !"}

        # Display Results
        Write-Warning "Suspicious Kerberos Tickets Found! <$(($SuspiciousTickets | Measure-Object).count) Ticket(s)>"
        
        # display to console
        switch ($CollectionMethod)
            {
                "WinRM" {$SuspiciousTickets | Select-Object @{N='ComputerName';E={$_.PSComputerName}},Anomaly,ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew}    
                "SMB" {$SuspiciousTickets | Select-Object @{N='ComputerName';E={$_.ComputerName}},Anomaly,ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew}
            }
        
        # display in a grid
        if (Test-Path "$PSHOME\powershell_ise.exe")
            {
                switch ($CollectionMethod)
                    {
                        "WinRM" {$SuspiciousTickets | Select-Object @{N='ComputerName';E={$_.PSComputerName}},Anomaly,ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Out-GridView -Title "Suspicious Kerberos Ticket(s)"}
                        "SMB" {$SuspiciousTickets | Select-Object @{N='ComputerName';E={$_.ComputerName}},Anomaly,ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Out-GridView -Title "Suspicious Kerberos Ticket(s)"}
                    }
            }
        
        # display computers with anomolous TGTs
        Write-Warning "$($ComputerWithAnomolousTGT.count) Computer(s) found with suspicious TGT(s) in memory:"
        $ComputerWithAnomolousTGT | foreach {Write-Host $_ -ForegroundColor Red}

        # Check if sessionSid does Not match Client name -> strong indication for suspicious TGT
        Write-Host "";
        $SuspiciousTickets | foreach {
                $SuspiciousT = $_;
                switch ($CollectionMethod)
                    {
                        "WinRM" {$Sid = $SuspiciousT.SessionSid.Value}
                        "SMB" {$Sid = $SuspiciousT.SessionSid}
                    }
                $UserObj = [adsi]"LDAP://<SID=$sid>";
                if ($SuspiciousT.ClientName -ne $UserObj.Properties.samaccountname) #Strong indication!
                    {
                        Write-Host "SessionSid Not matching ClientName (Name on TGT <> Primary process token owner):" -ForegroundColor Yellow;
                        switch ($CollectionMethod)
                            {
                                "WinRM" {$SuspiciousT | select pscomputername, clientname, SessionUserName, suspicious | Format-Table -AutoSize -Wrap}
                                "SMB" {$SuspiciousT | select computername, clientname, SessionUserName, suspicious | Format-Table -AutoSize -Wrap}
                            }
                    }
            }
    }
    else
    {
        Write-Host "[*] No suspicious entries found." -ForegroundColor Green;
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): No suspicious entries found"}
    }

# Save results to disk
if ($($FilteredTickets.Count) -gt 0)
	{
		$ReportName = ".\GoldFinger-KerberosTicketsCheck-Over_$CollectionMethod-Results-$(get-date -Format ddMMyyyyHHmmss).csv";
		switch ($CollectionMethod)
            {
                "WinRM" {$FilteredTickets | Select-Object @{N='ComputerName';E={$_.PSComputerName}},ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Export-csv $ReportName -NoTypeInformation}
                "SMB" {$FilteredTickets | Select-Object @{N='ComputerName';E={$_.ComputerName}},ClientName,Suspicious,SessionLogonServer,SessionKeyType,StartTime,EndTime,TimeDiffInHours,SessionUserName,SessionUserPrincipalName,TicketFlags,AltTargetDomainName,DomainName,EncodedTicket,EncodedTicketSize,KeyExpirationTime,RenewUntil,ServiceName,SessionAuthenticationPackage,SessionLogonType,SessionKey,SessionSid,SessionID,SessionLogonId,SessionLogonIdString,TargetDomainName,TimeSkew | Export-csv $ReportName -NoTypeInformation}
            }
		Write-Host "`n[*] All tickets report saved to $ReportName." -ForegroundColor Cyan;
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): All tickets report saved to $ReportName"}
	}

if ($SuspiciousTickets)
    {
        Write-Host "[*] Anomalous-Only tickets report saved to $AnomaliesReportName`n<May Includes multiple anomolous rules matched for the same ticket(s)>." -ForegroundColor DarkYellow;
        if ($LoggingLevel -eq 'Full') {Log-Entry -Message "$(Get-date): Anomalous-Only tickets report saved to $AnomaliesReportName`n<May Includes multiple anomolous rules matched for the same ticket(s)>"}
    }

# Wrap up (Switch back to original ErrorActionPreference & window title, and clean memory - in case shell is not closed after run)
if ($LoggingLevel -eq 'Full') {$global:sw.Close(); $global:sw.Dispose()}
Get-Job | Remove-Job -Force;
Clear-Variable CompletedJobsData, CompletedJobs, SuspiciousTickets, ComputerList, computers, AllComputers, AllComputersFiltered -ErrorAction SilentlyContinue;
Set-PreviousString;
[gc]::Collect()